import React from "react";
import Cards from "./components/Cards";
import "./App.css";
import { Grid } from "@material-ui/core";

function App() {
  return (
    <>
      <Grid container spacing={3} justify="center"></Grid>

      <div className="header">
        <h1>Covid-19 Tracker</h1>
      </div>
      <div>
        <Cards />
      </div>
    </>
  );
}

export default App;
